        alternative: 'React',
        id: 4
    },
    {
        image: redux,
        alternative: 'Redux',
        id: 5
    },
    {
        image: java,
        alternative: 'Java',
        id: 5
    },
    {
        image: python,
        alternative: 'Python',
        id: 7
    }
]

export default skills;
